import React from 'react';
import Card from './Cards';
import './App';
import Sdata from "./Sdata";


const App = () => (
  <>
  <h1 className="heading_style">List Of Top 4 Netflix Series</h1>

  {Sdata.map((val, index) => {
    console.log(index);
    return(
      <Card 
      key={val.id}
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      link={val.link} 
      />
    );

  })}
  </>,
  document.getElementById('root')
);
